window.bookSummaryJSON = "<p><b>With only one Challenge Dungeon Left, Nevermore is quickly winding to an end...</b><br> <br> The Nevermore Leaderboards competition has gathered more attention than perhaps in any era prior, with gods getting both directly and indirectly involved to see who will eventually come out on top.<br> <br> Jake, who has so far been performing above all expectations, enters his final Challenge Dungeon before it’s time to meet up with his party once more. Together, they’ll make a final push to try and climb as many floors as possible before time is up and, hopefully, in the end, find their names atop the Nevermore Leaderboards.<br> <br> However, the competition is tough. Jake and his party aren’t the only ones performing far above expectations. Ell’Hakan, the self-proclaimed rival of Jake, has set himself up to rival or even shatter all records prior, aiming for the top spot himself.<br> <br> In the end, who will prove themselves the top C-grade of their generation? <br> <br> And, perhaps more importantly to Jake, will there be a forced after-party following the Leaderboards reveal?<br> <br> <b>Book 12 of the hit Primal Hunter LitRPG Series is here. Grab your copy today!<br> <br> About the Series:</b> Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of Progression Fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
